import React from "react";
import { Box, Text } from "@chakra-ui/react";
function Game2() {
  return (
    <div>
      <Box
        display="flex"
        flexDirection="column"
        alignContent="center"
        mt={1}
        width="250px"
        height="250px"
      >
        <Text>Game2</Text>
      </Box>
    </div>
  );
}

export default Game2;
